import React from 'react';
import './App.css';

var loadScript = function(src) {
  var tag = document.createElement('script');
  tag.src = src;
  document.getElementsByTagName('body').appendChild(tag);
}

loadScript('main.js')

class App extends React.Component {
  render(){
    return (
      <div className="App">Welcome to typeracer!</div>
    );
  }
}

// const App = () => {
//   return (<div className="App">Welcome to typeracer!</div>);
//   }
export default App;
